My favorite part of the weekend is always breaking out a bunch of pairs each day, checking all of the brand spaces out and seeing which players make their mark in the events & games.

Which launches and debuts caught your eye at All Star? 👀👀

// Been after a pair of original Chrome CDubbz in my size for over 20 years — finally tracked em down !!

One of the all time wildest shoes debuted by @RealChrisWebber back at the 2002 All Star Game, when the league switched to no restrictions on shoes at ASW. 

Growing up in Sacramento, CWebb’s Dadas were among the most memorable joints from the early 2000s for me. Only 1,000 pairs were made and wearing them even once would most likely crack the chrome upper. Just a crazy concept that repped the era perfectly. #TrizadeMizark

// All-time day checking out the @Reebok Archives today in Boston ‼️

Growing up loving all the Shaq, Kemp & AI models of the 90s — was amazing to see some of the classics in OG form. 

What past Reeboks would you like to see explored and highlighted for a new era ahead?

